function searchCate() {
  /*查找分类关键词*/
  for (var j = 0; j < searchCateDict.length; j++) {
    var dom = searchCateDict[j];
    var len = $(dom).length;
    for (var i = len - 1; i >= 0; i--) {
      var txt = $(dom).eq(i).text().toLowerCase();
      var m = matchCate(txt);
      if (m) {
        setTariff(m);
        return;
      }
    }
  }
}

